        { id: 3, title: "Javascript 3", body: "Description" },
        { id: 4, title: "Javascript 4", body: "Description" },
    ]);

    return (
        <div className="App">
            <form>
                <MyInput children="Y"/>
                <MyInput/>
                <MyButton>Создать пост</MyButton>
            </form>
            <PostList posts={posts} title="Пост 1" />
        </div>
    );
}

export default App;
